import React from "react";
import Card from "./card";
import "./expenselist.css";
export default function ExpenseList() {
  const list = [
    {
      title: "made a purchase",
      price: 1234,
      createdAt: Date.now(),
    },
    {
      title: "made a purchase",
      price: 1234,
      createdAt: Date.now(),
    },
    {
      title: "made a purchase",
      price: 1234,
      createdAt: Date.now(),
    },
  ];
  return (
    <div className="list-parent">
      {list.length ? (
        list.map((item) => {
          <div>
            <Card list={list} />
          </div>;
        })
      ) : (
        <></>
      )}
    </div>
  );
}
